import logo from './logo.svg';
import './App.css';
import Filter from './Component/Filter/index'
import TodoList from './Component/TodoList/index'
import { useEffect } from 'react';
import {useDispatch} from 'react-redux'
import { FetchTodo } from './Component/TodoList/TodoListSlide';
import { SetupServer } from './Component/fakeapi';
import { Priority } from './redux/selector';
if(process.env.NODE_ENV !== 'development')
{
  SetupServer();
}
function App() {
  const dispatch = useDispatch();
  useEffect(()=>{
    //dispatch(FetchTodo())
    fetch('api/todos',{
      method:'POST',
      body: JSON.stringify({
        id:1,
        name:'Dai',
        completed:false,
        priority:'High',
      }),
    }).then((res)=>{
        fetch('api/todos')
        .then((res)=>res.json())
        .then((res)=>console.log(res))
        .then(response => {
    // Kiểm tra nếu phản hồi không thành công
    if (!response.ok) {
      throw new Error('Network response was not ok');
    }
    // Kiểm tra nếu phản hồi không phải là JSON
    const contentType = response.headers.get('content-type');
    if (!contentType || !contentType.includes('application/json')) {
      throw new TypeError("API did not return JSON");
    }
    // Trả về phân tích JSON của dữ liệu
    return response.json();
  })
  .then(data => {
    // Xử lý dữ liệu JSON ở đây
    console.log(data);
  })
  .catch(error => {
    // Xử lý lỗi ở đây
    console.error('Fetch error:', error);
  });
      });
  },[])
  return (
    <div className="App">
      <Filter/>
      <TodoList/>
    </div>
  );
}

export default App;
